import React, { Component } from 'react'
import LeftArrowButton from './LeftArrowButton'

export default class WeekSelect extends Component {
  render() {
    return (
      <div>
        <LeftArrowButton />
        <p className="week">April</p>
        <RightArrowButton></RightArrowButton>
      </div>
    )
  }
}
